import React, { useState } from "react";
import {
  Box,
  Button,
  NumberInput,
  NumberInputField,
  NumberInputStepper,
  NumberIncrementStepper,
  NumberDecrementStepper,
  SliderTrack,
  Flex,
  Slider,
  SliderFilledTrack,
  SliderThumb,
} from "@chakra-ui/react";

function Epoch() {
  const [writeQ, setWriteQ] = useState(0);
  const [readQ, setReadQ] = useState(0);
  const handleChange1 = (value) => setWriteQ(value);
  const handleChange2 = (value) => setReadQ(value);
  const Quorum={
    write:0,
    read:0
  }
  return (
    <Box ml={100} mt={50} mb={100} maxW={350} pos="relative" left="900">
      <form>
        <Flex>
          <NumberInput
            maxW="100px"
            mr="2rem"
            value={writeQ}
            onChange={handleChange1}
          >
            <NumberInputField />
            <NumberInputStepper>
              <NumberIncrementStepper />
              <NumberDecrementStepper />
            </NumberInputStepper>
          </NumberInput>
          <Slider
            flex="1"
            focusThumbOnChange={false}
            value={writeQ}
            onChange={handleChange1}
          >
            <SliderTrack>
              <SliderFilledTrack />
            </SliderTrack>
            <SliderThumb fontSize="sm" boxSize="32px" children={writeQ} />
          </Slider>
        </Flex>
        <Flex mt={50}>
          <NumberInput
            maxW="100px"
            mr="2rem"
            value={readQ}
            onChange={handleChange2}
          >
            <NumberInputField />
            <NumberInputStepper>
              <NumberIncrementStepper />
              <NumberDecrementStepper />
            </NumberInputStepper>
          </NumberInput>
          <Slider
            flex="1"
            focusThumbOnChange={false}
            value={readQ}
            onChange={handleChange2}
          >
            <SliderTrack>
              <SliderFilledTrack />
            </SliderTrack>
            <SliderThumb fontSize="sm" boxSize="32px" children={readQ} />
          </Slider>
        </Flex>
        <Button type="submit" colorScheme="teal" variant="solid" mt={10}>
          Submit
        </Button>
      </form>
    </Box>
  );
}

export default Epoch;
